Линейный корабль: 
*  в широком значении, корабль, предназначенный для боевых действий в составе эскадры; 
*  в традиционном значении (также сокращенно линкор), — класс тяжёлых бронированных артиллерийских боевых кораблей водоизмещением от 20 до 70 тысяч тонн, длиной от 150 до 280 м, при калибре орудий главного калибра 280—460 мм, с экипажем в 1500—2800 человек. Линкоры применялись в XX веке для уничтожения кораблей противника в составе боевого соединения и артиллерийской поддержки сухопутных операций. Являлись эволюционным развитием броненосцев второй половины девятнадцатого века.

